di={version:"0.1.0",createContext:function(){var ctx={map:{}};ctx.register=function(name,type){ctx.map[name]=new type};ctx.find=function(name){return ctx.map[name]};ctx.initialize=function(){var name;for(name in ctx.map){var o=ctx.find(name);var dependencyName=o.dependencies;var dependency=ctx.find(dependencyName);o[dependencyName]=dependency}};return ctx}};